#include "tests.h"

template <class C>
void print_containter(const C &p)
{
	if (p.empty())
		cout << "empty";

	for (auto c : p)
		cout << c << " ";
	cout << endl;
}

template <class C>
C list_get(const std::list<C> l, size_t index)
{
	if (index >= l.size())
		return 0;

	auto it = l.begin();
	for (; index > 0; index --, it++);
	return *it;
}

